import { NavLink } from "react-router-dom";


function MainNavigation() {
    return (
        <>
            <header>
                <nav>
                    <ul>
                        <li><NavLink to="/">Homepage</NavLink></li>
                        <li><NavLink to="/EventsPage">Event Page</NavLink></li>
                        <li><NavLink to="/EventDetailPage">Event Detail Page</NavLink></li>
                        <li><NavLink to="/EventDetailPage">Home</NavLink></li>
                        <li><NavLink to="/EventDetailPage">Home</NavLink></li>
                    </ul>
                </nav>
            </header>
        </>
    );
}

export default MainNavigation;
